async function getScoutRanks(){document.getElementById("viewScoutsButton").innerHTML="Requesting Data...";let e=new XMLHttpRequest;e.open("GET","/api/scouts",!0),e.withCredentials=!0,e.onreadystatechange=async()=>{if(e.readyState===XMLHttpRequest.DONE&&200===e.status){document.getElementById("viewScoutsButton").innerHTML="Rendering View...";let t=JSON.parse(e.responseText);for(var n="",s=0;s<t.length;s++)"true"==t[s].accessOk&&(n+=`<tr><td><a href="/browse?userId=${t[s].id}" style="all: unset; color: #2997FF; text-decoration: none;">${t[s].nickName} (${t[s].team})</a></td><td>${Math.round(t[s].score)}</td></tr>`);document.getElementById("preInsert").insertAdjacentHTML("afterend",n),document.getElementById("eventCodeDisplay").innerHTML="Top scouts",document.getElementById("viewScoutsButton").innerHTML="Reload Data"}else 204===e.status&&e.responseText==String(3265)?document.getElementById("viewScoutsButton").innerHTML="no results":401===e.status||403===e.status?window.location.href="/login":400===e.status?document.getElementById("viewScoutsButton").innerHTML="bad request":500===e.status?document.getElementById("viewScoutsButton").innerHTML="internal server error":document.getElementById("viewScoutsButton").innerHTML="downloading data..."},e.send()}